package ex_25042024SwitchCase;

public class Lab085 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		byte b=50;
        switch(b){
            case 10:
                System.out.println("TEN");
                break;
            case 127:
                System.out.println("ONE TWENTY EIGHT");
                break;
            default:
                System.out.println("Default");
        }

	}

}
